          </Typography>
        </Box>
        <Typography sx={{ fontSize: "10px", color: THEME.GREEN_PRIMARY }} onClick={()=>setItem(item => [...item, ItemCheckout("Nama", 50000)])}>
          Hapus
        </Typography>
      </Box>

      <Box
        sx={{
          height: "1px",
          width: PADDING,
          background: "#F5F5F5",
          mt: "11px",
        }}
      />

      {/* 1 */}
      <Box
        sx={{
          display: "flex",
